import React from 'react';
import logo from '../img/Logo.png';
import { IconButton } from '@material-ui/core';

const Logo = () =>{
 return <IconButton>
     <img src={ logo } alt="Xiaomi" width={32} height= {32} />
  </IconButton>
}

export default Logo;
